/* eslint-disable */
import axios from "axios";

function Search(breed, typeSelect, names) {
  const arr = names.split(" ");
  var output = "";
  var vars = [{}];

  for (var i in arr) {
    var queryWords = breed + " " + arr[i] + "\n";
    vars.push({ key: queryWords, value: "" });
    output += queryWords;
  }
  return output;
}

export default Search;
